import React from 'react';

import { Menu } from 'antd';

const NavBar = () => {
	return (
		<div>
			<Menu mode='horizontal'>
				<Menu.Item>Home</Menu.Item>
				<Menu.Item>Coffee</Menu.Item>
				<Menu.Item>About</Menu.Item>
			</Menu>
		</div>
	);
};

export default NavBar;
